  if (start === '' || !start) {
    return retVal;
  } else {
    for (const i of sets) {
      if (i && i.startsWith(start)) {
        retVal += retVal.length === 0 ? i.replace(start, '') : i.replace(start, '-');
      }
    }
  }
  return retVal;
}

